                        <img src={UpperWear6} alt="UpperWear6" style={{ height: '300px', backgroundColor: '#E8E8E8', transition: 'transform 0.2s', paddingRight: '30px', paddingLeft: '30px' }} onMouseOver={(e) => {
                            e.currentTarget.style.transform = 'scale(1.05)';
